    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then                                 U.S. Census Bureau's Master Address File
    / Topologically Integrated Geographic Encoding and Referencing (MAF/TIGER) Database
    (MTDB).n                                 The MTDB represents a seamless national
    file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed ton                                 stand alone as an independent data
    set, or they can be combined to cover the entire nation.nn                                 The
    MTDB represents a seamless national file with no overlaps or gaps between parts,
    however, each TIGER/Line File is designed to standn                                 alone
    as an independent data set, or they can be combined to cover the entire nation.
     The Feature Names Relationship Filen                                 (FEATNAMES.dbf)
    contains a record for each feature name and any attributes associated with it.  Each
    feature name can be linked to then                                 corresponding
    edges that make up that feature in the All Lines Shapefile (EDGES.shp), where applicable
    to the corresponding addressn                                 range or ranges in
    the Address Ranges Relationship File (ADDR.dbf), or to both files.  Although this
    file includes feature names forn                                 all linear features,
    not just road features, the primary purpose of this relationship file is to identify
    all street names associatedn                                 with each address range.
     An edge can have several feature names; an address range located on an edge can
    be associated with one or anyn                                 combination of the
    available feature names (an address range can be linked to multiple feature names).
     The address range is identifiedn                                 by the address
    range identifier (ARID) attribute, which can be used to link to the Address Ranges
    Relationship File (ADDR.dbf).  Then                                 linear feature
    is identified by the linear feature identifier (LINEARID) attribute,  which can
    be used to relate the address range backn                                 to the
    name attributes of the feature in the Feature Names Relationship File or to the
    feature record in the Primary Roads, Primary andn                                 Secondary
    Roads, or All Roads Shapefiles. The edge to which a feature name applies can be
    determined by linking the feature name recordn                                 to
    the All Lines Shapefile (EDGES.shp) using the permanent edge identifier (TLID) attribute.
     The address range identifier(s) (ARID)n                                 for a
    specific linear feature can be found by using the linear feature identifier (LINEARID)
    from the Feature Names Relationship Filen                                 (FEATNAMES.dbf)
    through the Address Range / Feature Name Relationship File (ADDRFN.dbf).  n            ",nt"license_title":
